/**
 * MERGE method will send update requests in a MERGE request
 * @public
 * 
 * @memberof sap.ui.model.odata.UpdateMethod
 */
sap.ui.model.odata.UpdateMethod.Merge = undefined;

/**
 * PUT method will send update requests in a PUT request
 * @public
 * 
 * @memberof sap.ui.model.odata.UpdateMethod
 */
sap.ui.model.odata.UpdateMethod.Put = undefined;

